import {
  ArrowBackIosOutlined,
  ArrowForwardIosOutlined,
} from "@material-ui/icons";
import "./list.scss";
import ListItem from "../listItem/ListItem";

const List = () => {
  return (
    <div className="list">
      <span className="listTitle">Continue watching</span>
      <div className="wrapper">
        <ArrowBackIosOutlined />
        <div className="container">
          <ListItem />
          <ListItem />
        </div>
        <ArrowForwardIosOutlined />
      </div>
    </div>
  );
};

export default List;
